import React from "react";
import "../../styles/Offer/Offer.css";

function Offer() {
  return (
    <div className="offer">
      <div className="container">
        <div className="offer-content">
          <ul>
            <li>02 Days</li>
            <li>10 Hours</li>
            <li>34 Mins</li>
            <li>60 Secs</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Offer;
